import React from 'react'
import '../../styles/about.css';

const About = () => {
  return (
   <>
   <section id="abount">
    <div className="container">
        <div className="abount__wrapper">
            <div className="about__content"></div>
        </div>
    </div>
   </section>
   </>
  )
}

export default About
